.footer {
    background-color: hsl(216, 53%, 9%);
    padding-top: 240px;
    padding-left: 18px;
    padding-right: 18px;
    padding-bottom: 30px;
    .footer_bloc {
        .footer_logo {
            padding-left: 10px;
            width: 150px;
            margin-bottom: 40px;
        }
        .footer_container {
            .footer_location {
                display: flex;
                flex-direction: row;
                align-items: flex-start;
                margin-bottom: 40px;
                .location_logo {
                    margin-right: 20px;
                }
                .location_parg {
                    text-align: left;
                    font-family: "OpenSans_Regular";
                    font-size: 14px;
                    line-height: 22px;
                    font-weight: 500;
                    font-style: normal;
                    color: white;
                    max-width: 255px;
                }
            }
            .footer_contacts {
                margin-bottom: 40px;
                display: flex;
                flex-direction: column;
                .phone {
                    margin-bottom: 20px;
                    font-family: "OpenSans_Regular";
                    font-size: 14px;
                    line-height: 22px;
                    font-weight: 500;
                    font-style: normal;
                    text-align: left;
                    color: white;
                    .phone_icon {
                        margin-right: 20px;
                    }
                }
                .email {
                    font-family: "OpenSans_Regular";
                    font-size: 14px;
                    line-height: 22px;
                    font-weight: 500;
                    font-style: normal;
                    text-align: left;
                    color: white;
                    .email_icon {
                        margin-right: 20px;
                    }
                }
                a:hover {
                    span {
                        color: blue;
                    }
                }
            }
            .footer_navigation {
                display: flex;
                flex-direction: column;
                ul {
                    li {
                        margin-bottom: 10px;
                        a:hover {
                            font-weight: bolder;
                        }
                    }
                }
                .first_link--lists {
                    margin-bottom: 20px;
                    display: flex;
                    flex-direction: column;
                    align-items: flex-start;
                    li {
                        a {
                            color: white;
                            font-family: "OpenSans_Regular";
                            font-size: 14px;
                            line-height: 22px;
                            font-weight: 500;
                            font-style: normal;
                            text-align: left;
                            white-space: nowrap;
                        }
                    }
                }
                .second_link--lists {
                    margin-bottom: 20px;
                    display: flex;
                    flex-direction: column;
                    align-items: flex-start;
                    li {
                        a {
                            color: white;
                            font-family: "OpenSans_Regular";
                            font-size: 14px;
                            line-height: 22px;
                            font-weight: 500;
                            font-style: normal;
                            text-align: left;
                            white-space: nowrap;
                        }
                    }
                }
            }
            .footer_links {
                .footer_links--lists {
                    display: flex;
                    flex-direction: row;
                    li {
                        a {
                            color: white;
                            font-family: "OpenSans_Regular";
                            font-size: 14px;
                            line-height: 22px;
                            font-weight: 500;
                            font-style: normal;
                            text-align: left;
                        }
                        a:hover {
                            font-weight: bolder;
                        }
                    }
                    li:not(:last-of-type) {
                        margin-right: 20px;
                    }
                }
            }
        }
    }
}

